INSERT INTO `proof_readings` (`id`, `user_id`, `teacher`, `content`, `created_at`, `updated_at`) VALUES
(1, 2, NULL, '<p>When Frank and I stepped through the post office doors, there was a crowd gathered, gawking at the new fixture on the wall like a chorus of wide-mouthed frogs. I had to get closer, and that was where being a girl that\'s scrawnier than a wire fence came in handy. Fortunately, Frank, my twin of eleven years, was just the same.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; \"Come on.\" I said, grabbing his hand, and we slid through the cracks between people until we spilled out in front.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Finally I got a good look. It was fixed to the plaster next to the postmaster\'s window, the place of honor usually reserved for the Wanted posters. Beady-eyed Zedekiah Smith, the bank robber, still hung there, but even he had been pushed aside for something more important.</p>', '2019-06-20 22:17:50', '2019-06-20 22:17:50'),
(2, 2, NULL, 'The&nbsp;merge&nbsp;method merges the given array or collection with the original collection. If a string key in the given items matches a string key in the original collection, the given items\'s value will overwrite the value in the original collection:', '2019-06-23 21:57:02', '2019-06-23 21:57:02');
